import React from "react";
import Navbar from "./Navbar";
const Wcards = () => {
    const Warr = [
    {
        id : 6,
        link : "https://m.media-amazon.com/images/M/MV5BMjhiMzgxZTctNDc1Ni00OTIxLTlhMTYtZTA3ZWFkODRkNmE2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_UY209_CR5,0,140,209_AL_.jpg",
        title : "Breaking Bad",
        what : "Web-Series",
        Date : "2008-2013",
        Watch : "https://www.imdb.com/title/tt0903747/?ref_=ttls_li_tt"
    },
    {
        id : 7,
        link : "https://m.media-amazon.com/images/M/MV5BYTRiNDQwYzAtMzVlZS00NTI5LWJjYjUtMzkwNTUzMWMxZTllXkEyXkFqcGdeQXVyNDIzMzcwNjc@._V1_UY209_CR7,0,140,209_AL_.jpg",
        title : "Game OF Thrones",
        what : "Web-Series",
        Date : "2011-2019",
        Watch : "https://www.imdb.com/title/tt0944947/?ref_=ttls_li_tt"
    },
    {
        id : 8,
        link : "https://m.media-amazon.com/images/M/MV5BZGQ2YmMxZmEtYjI5OS00NzlkLTlkNTEtYWMyMzkyMzc2MDU5XkEyXkFqcGdeQXVyMzQ2MDI5NjU@._V1_UX140_CR0,0,140,209_AL_.jpg",
        title : "Chernobyl",
        what : "Web-Series",
        Date : "2019",
        Watch : "https://www.imdb.com/title/tt7366338/?ref_=ttls_li_tt"
    },
    {
        id : 9,
        link : "https://m.media-amazon.com/images/M/MV5BZWJiMDZmNTAtZDg5YS00NDgyLThkMzctYTczZjllNzU0YWY5XkEyXkFqcGdeQXVyMTAwMDI3ODEw._V1_UX140_CR0,0,140,209_AL_.jpg",
        title : "Asur",
        what : "Web-Series",
        Date : "2020-",
        Watch : "https://www.imdb.com/title/tt11912196/?ref_=ttls_li_tt"
    },
    {
        id : 10,
        link : "https://m.media-amazon.com/images/M/MV5BOTk2NzUyOTctZDdlMS00MDJlLTgzNTEtNzQzYjFhNjA0YjBjXkEyXkFqcGdeQXVyMjg1NDcxNDE@._V1_UY209_CR0,0,140,209_AL_.jpg",
        title : "Dark",
        what : "Web-Series",
        Date : "2017-2020",
        Watch : "https://www.imdb.com/title/tt5753856/?ref_=ttls_li_tt"
    }
    ]
    return (
        Warr.map((val, index) => {
            return (
                <Navbar
                    key={index}
                    images={val.link}
                    title={val.title}
                    date={val.Date}
                    btao={val.what}
                    links = {val.Watch}
                />
            )
        })
    )
}

export default Wcards;
